transitions.content:
/*
Author: Benjo Co
Description: This is for High Tech Burrito Template Only
Version: 1.0
*/
@charset 'utf-8';
/* CSS DOCUMENT */
html , body { height: auto !important;  width:100%;  background:url(images/page_template/whole-bg.jpg) no-repeat; background-attachment:fixed; background-position:center; background-size: 100%;  }

/*********
	Page Template
*********/
#main-container { width:1010px; min-height:669px; margin:0 auto; padding-bottom:12px; background:url(images/page_template/main-bg.png) repeat-y 0 0; position:relative;  }

#header-wrapper { width:991px; margin-left:18px; position:absolute; top:-37px; z-index: 9999; }

#main-wrapper { width:935px; margin:0 auto; }

#footer-wrapper { width:1018px; height:42px; margin:0 auto; background:url(images/page_template/footer-bg.png) no-repeat;  margin-top: -20px; position: relative; z-index: 9; padding:14px 0 50px 0; }

#head-bg { width:1010px; margin:37px auto 0 auto; }

.guide { border:1px solid red; }
strong, s, strike, del user agent stylesheet { text-decoration: none !important; }

strong, s, strike, del user agent stylesheet { text-decoration: none !important; }


@font-face {
	font-family: 'Conv_HelveticaNeueLTStd-MdCn';
	src: url('fonts/HelveticaNeueLTStd-MdCn.eot');
	src: local('?'), url('fonts/HelveticaNeueLTStd-MdCn.woff') format('woff'), url('fonts/HelveticaNeueLTStd-MdCn.ttf') format('truetype'), url('fonts/HelveticaNeueLTStd-MdCn.svg') format('svg');
	font-weight: normal;
	font-style: normal;
}
@font-face {
	font-family: 'Conv_HelveticaNeueLTStd-Cn';
	src: url('fonts/HelveticaNeueLTStd-Cn.eot');
	src: local('?'), url('fonts/HelveticaNeueLTStd-Cn.woff') format('woff'), url('fonts/HelveticaNeueLTStd-Cn.ttf') format('truetype'), url('fonts/HelveticaNeueLTStd-Cn.svg') format('svg');
	font-weight: normal;
	font-style: normal;
}
@font-face {
	font-family: 'Conv_HelveticaNeue-CondensedBold';
	src: url('fonts/HelveticaNeue-CondensedBold.eot');
	src: local('?'), url('fonts/HelveticaNeue-CondensedBold.woff') format('woff'), url('fonts/HelveticaNeue-CondensedBold.ttf') format('truetype'), url('fonts/HelveticaNeue-CondensedBold.svg') format('svg');
	font-weight: normal;
	font-style: normal;
}

@font-face {
    font-family: 'alternate_gothic_no1_dregular';
    src: url('fonts/ufonts.com_alternate_gothic_no1_d-webfont.eot');
    src: url('fonts/ufonts.com_alternate_gothic_no1_d-webfont.eot?#iefix') format('embedded-opentype'),
         url('fonts/fonts/ufonts.com_alternate_gothic_no1_d-webfont.woff') format('woff'),
         url('fonts/ufonts.com_alternate_gothic_no1_d-webfont.ttf') format('truetype'),
         url('fonts/ufonts.com_alternate_gothic_no1_d-webfont.svg#alternate_gothic_no1_dregular') format('svg');
    font-weight: normal;
    font-style: normal;

}


/*HEADER*/
.logo { width:191px; height:188px; float:left;  }
.menu { width:800px; height:62px; background:url('images/page_template/menu-bg.png') no-repeat; float:right; }  
.menu { list-style:none;}
.menu li { float:left; padding: 24px 0 0 64px;}
.menu li:first-child {  padding: 24px 0 0 70px;}
.menu li a { text-decoration:none; color:#fbfbfb; padding:0 0 0 0; font-family: 'Conv_HelveticaNeueLTStd-MdCn'; text-transform:uppercase; font-size:14px; text-shadow: 0 0 0.2em #000, 0 0 0.2em #000, 0 0 0.2em #000}
.menu li a:hover, .footer-menu li a:hover { color:#ffcc33; }
.current_page_item a, current-menu-item a { color:#ffcc33 !important; }


/*HOME PAGE*/
.banner-hldr { width:924px; height:480px; margin-left: 5px; }
.widget-hldr { width:927px; margin:0 auto;  }
.widget-hldr ul {list-style:none;  }
.widget-hldr ul li { width:280px; min-height: 145px; float:left; background:rgba(0,0,0, 0.5); margin-top:20px; -webkit-border-top-left-radius: 12px;
-webkit-border-top-right-radius: 12px; -moz-border-radius-topleft: 12px; -moz-border-radius-topright: 12px; border-top-left-radius: 12px; border-top-right-radius: 12px;  font-family: 'Conv_HelveticaNeueLTStd-Cn'; padding:13px 0 6px 17px; }

.widget-hldr ul li h3 { color:#ffc94e; font-size:24px; font-weight:normal; text-transform: uppercase;}
.widget-hldr ul li h3 a { color:#ffc94e; text-decoration:none; }
.widget-hldr ul li:first-child { margin-right:14px; }
.widget-hldr ul li:last-child { width:285px; float:right; background:none;  position:relative; }
.w-content-hldr { margin-left:18px; margin-top:18px; width:232px; }
.w-content-hldr p { color:#999999; font-size:11px; font-family:'arial'; margin-bottom:10px; }
.w-content-hldr h4 a { color:#f5ab1c; font-size:14px; text-decoration:none; }
.widget-hldr ul li:nth-child(2) h4 a { color:#961010; font-size:14px; text-decoration:none; }
.w-content-hldr h4  { margin-bottom:3px; }
.w-content-hldr h4 img { opacity:0.5; }

.widget-hldr ul li h2 { color:#ac0d16; font-size:24px; font-weight:normal;}
.widget-hldr ul li h2 a { color:#ac0d16; text-decoration:none;}
.widget-hldr ul li:last-child h2 { color:#cccccc; font-size:24px; font-weight:normal; text-transform:uppercase;}
.widget-hldr ul li:last-child p { color:#ffffff; }

.social-bg { position:absolute; left:0; width:100%;background:rgba(0,0,0, 0.5); -webkit-border-top-left-radius: 12px;
-webkit-border-top-right-radius: 12px; -moz-border-radius-topleft: 12px; -moz-border-radius-topright: 12px; border-top-left-radius: 12px; border-top-right-radius: 12px; }
.social-bg div { float:left; }
.twit  { height:49px; margin-top:10px; background:url(images/home/devider.png) center right no-repeat;  }
.twit a { display:block; padding:0 20px; margin-top: 7px; }
.fb  { height:49px; background:url(images/home/devider.png) center right no-repeat;  margin-top:10px; }
.fb a { padding:0 20px;  }
.yelp { padding: 0 0 0 16px; }


/* FOOTER */
.footer-logo { width:86px; height:97px; position: absolute; left: 50%; top: -34%; }
.foot-menu-hldr { width:465px; float:left; margin:0 0 0 31px; }
.footer-menu { list-style:none; }  
.footer-menu li {float:left;}  
.footer-menu li a { border-right:1px solid #fcc24b; color:#cccccc; font-family: 'Conv_HelveticaNeue-CondensedBold'; font-size:10px; text-decoration:none; padding:0 10px	; text-transform:uppercase; letter-spacing:1px;}  
.footer-menu li:first-child a { padding:0 12px 0 0; }
.copyright { width:389px; float:right; color:#cccccc; font-family: 'Conv_HelveticaNeue-CondensedBold'; font-size:10px; letter-spacing:1px; text-transform:uppercase; }


/** DEFAULT PAGE **/
.left-nav-bg { width:139px; height:593px; float:left; background-color: rgb(37,0,0); background-color:rgba(37,0,0, 0.9); display:block; margin-top:47px; border:1px solid #fff; -moz-box-shadow: 0 1px 19px 7px #000; -webkit-box-shadow: 0 1px 19px 7px #000; box-shadow: 0 1px 19px 7px #000;margin-left: 6px;}
.left-nav { width:111px; margin:auto; margin-top: 136px; }
.left-nav h2 { color:#fff; font-size:18px; font-family: 'Conv_HelveticaNeue-CondensedBold'; letter-spacing: 1px; }


.page-right { width:780px; min-height:500px; float:left; margin-top: 10px; padding-bottom: 21px; }
.banner-pages { width:100%; height:212px; border:1px solid white; -moz-box-shadow: 0 1px 19px 7px #000; -webkit-box-shadow: 0 1px 19px 7px #000; box-shadow: 0 1px 19px 7px #000; position:relative; }
.banner-pages h1 { color:#ac0d16; font-weight:bold; position:absolute; bottom:15px; text-align:center; left: 122px; font-size:50px; font-family: 'alternate_gothic_no1_dregular'; }
.banner-pages h1 span { float:left; display:block; }
/*.title-margin { margin-top: -28px; margin-left: 17px; margin-right:19px; }*/

.page-content-hldr { width:747px; float:right; margin-top:15px; }
.page-content-hldr span { display:block; color:#fcc24b; font-size:24px; font-family: 'Conv_HelveticaNeue-CondensedBold'; margin-bottom: 24px; }
.page-content-hldr span strong { font-size:36px; display:block; }

.scroll-hldr { display:block; width:741px; margin-bottom: 11px; } 
.scroll-hldr p { width:711px; color:#ffffff; font-family:'Arial'; font-size:13px; text-align:justify;  margin-top:5px; }
.scroll-hldr p:first-child { }
.scroll-hldr p a { color:#fcc24b !important; text-decoration:none; }
.extrafields p a { color:#fcc24b !important; text-decoration:none; }

.scroll-hldr::-webkit-scrollbar {   width: 12px;} 
.scroll-hldr::-webkit-scrollbar-track {   -webkit-box-shadow: inset 0 0 6px rgba(0,0,0,0.3);   border-radius: 10px;}
.scroll-hldr::-webkit-scrollbar-thumb {   border-radius: 10px; -webkit-box-shadow: inset 0 0 6px rgba(0,0,0,0.5); }

.extrafields  { width:445px; height:156px; overflow-y:auto; font-family: 'Conv_HelveticaNeue-CondensedBold'; color:#f1e4c8; font-size:20px; margin-left: 33px; margin-top:24px; }
.extrafields span { color:#fcc24b; }
.page-fetured { float:right; }
.page-fetured img { border:1px solid white; -moz-box-shadow: 0 1px 19px 7px #000; -webkit-box-shadow: 0 1px 19px 7px #000; box-shadow: 0 1px 19px 7px #000; }

.child-pages li  { background:url(images/page_template/list-style.png)  0 50% no-repeat !important; list-style:none; padding-left: 11px; margin-left: 5px; }
.child-pages li a { color:#fff; text-decoration:none; font-size:14px; font-family: 'Conv_HelveticaNeue-CondensedBold'; }

table tr td { /*width:200px;*/ color:#fff !important; padding-bottom:10px !important;}
table tr td a { color:#fcc24b !important; }

.foot-bg { width:1018px;margin:0 auto; }
div.left { width:47%; color:#fff;float:left; margin-left:43px; margin-top: 13px; }
div.right { width:40%;  float:left;}
div.right input { width:50%; height:15px; font-size: 12px;}
div.right input[type="submit"] { width:auto; height:auto; }
div.right textarea { width:50%; height:62px; font-size: 12px;}
div.right select { font-size: 12px;}
.form-hldr ul { list-style:none; }  
.question-2 { background-color: rgb(158, 159, 162); padding:15px 10px; color:#fff;}
span.wpcf7-list-item { margin-left:0 !important; width: auto; float: left; margin-right:15px; text-align:center;}
.wpcf7-list-item-label { margin-top: -46px; color:#fff !important; background:rgb(158, 159, 162); padding:0 20px;  }
/*********
	END Page Template
*********/

